import React from "react";
import { Typography, TextField, Grid ,Button } from "@mui/material";
import "./App.css";
import logo from "./images/light-logo.png";

function App() {
  const popupStyle = {
    backgroundColor: "rgb(100, 64, 189)",
    width: "25%",
    height: "90vh",

  };

  const textFieldStyle = {
    backgroundColor: "white",
    marginTop: "10px", // Reduce the top margin for the password field
    width: "400px",
    borderRadius: "20px",
  };

  return (
    <div className="App" style={popupStyle}>
      <Grid container>


      <img style={{ width: "200px" ,marginLeft:"50px" ,padding:"20px"}} src={logo} alt="logo" />
      <Typography style={{ marginLeft:"40px" ,padding:"30px" }}>Sign in to your account</Typography>

      <TextField
        id="outlined-basic"
        label="Enter your email..."
        variant="outlined"
        style={textFieldStyle}
      />
      <div style={{ marginLeft: "290px", marginTop: "10px" }}>Forgot?</div>
      <TextField
        id="outlined-basic"
        label="Enter your password..."
        variant="outlined"
        style={textFieldStyle}
      />

      <Grid container justifyContent="space-evenly" style={{ marginTop: "30px" }}>
        <Typography>
          No Account ?
        </Typography>
        <Typography>
          Sign Up
        </Typography>
        <Grid item>
          <Button style={{ backgroundColor:"white" , width:"30px" }}>Sign In</Button>
        </Grid>
      </Grid>
      </Grid>
    </div>
  );
}

export default App;
